//import Box2 from './Box2';
import React, { useState, useEffect } from 'react';
import '../index.css';

const mice = [];


function Simulation(props){

    useEffect(() => {
        for(let i = 0; i < 10; i++){
            mice[i] = {id: i};
        }
    }, []);

    const miceItems = mice.map(mouse => 
        <li key={mouse.id}>
          <p className={'mouse mouse_'+mouse.id}>Mouse</p>

        </li>
      )

    return (
       <>{miceItems}
       </>
    );
}

export default Simulation;
